import React from 'react';
import PropTypes from 'prop-types';

const Display = (props) => (
    <div className="mt-md-2" >
        <div >{props.currentValue}</div>
    </div>
);

Display.defaultProps = {
    expression: '',
    currentValue: '0'
};

Display.propTypes = {
    currentValue: PropTypes.string
};

export default Display;
